('2402','18','7925','Villa Katie',Null,'Villa in 2. Meereslinie in Alt Bendinat zu verkaufen','33757','Alt Bendinat gehört zu den beliebtesten Wohnlagen im Südwesten von Mallorca. Der Edel-Hafen Porto Portals, mit seinen Restaurants und mehrere internationale Privatschulen sind nur 5 Fahrminuten entfernt. Die Villa wurde 2001 auf einem ca 1.000m² großen Grundstück erstellt und 2006 vom jetzigen Besitzer saniert. Über den Eingang im EG betritt man das großzügige Wohn- Esszimmer mit Zugang zum Pool und seinen Terrassen. Des Weiteren hat man noch ein Büroraum, moderne offene Küche, Kinderspielzimmer, Hauswirtschaftraum, Abstellraum und Gäste WC. \r\nÜber eine Eichentreppe gelangt man ins 1. OG mit Masterschlafzimmer mit Bad en suite, ein 2. Schlafzimmer mit Bad en suite, 3 Gästeschlafzimmer und 2 Badezimmer. Alle Schlafzimmer haben Zugang zu einer Terrasse mit Meerblick. Für die Autos stehen 4 offene Parkplätze zur Verfügung. Ein separates Gästeapartment und ein Weinkeller runden das Angebot ab\r\n','33758','5800000','106','2015-11-24 09:38:20','106','2015-11-24 09:39:41',Null,'2519','72','1182',1,'1','0',Null,Null,Null,'33759',Null,'0','0','0',Null,'2015-11-24 09:54:42',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33760',Null,'33761',Null,'33762',Null,'33763','619 679 046      katiemora@gmail.com','33764','0',0,'0');
